import { Component } from '@angular/core';

@Component({
  selector: 'app-expenses',
  templateUrl: './expenses.component.html',
  styleUrls: ['./expenses.component.css'],
})
export class ExpensesComponent {
  expenses = [
    {
      id: 1,
      expenseAmount: 2500,
      youOwe: 300,
      currency: 'HUF',
      groupName: 'Borok',
      payerName: 'Bede',
      distributionType: 'equally',
    },
    {
      id: 2,
      expenseAmount: 10000,
      youOwe: 2000,
      currency: 'HUF',
      groupName: 'Jegyek',
      payerName: 'Csilla',
      distributionType: 'equally',
    },
    {
      id: 1,
      expenseAmount: 5500,
      youOwe: 900,
      currency: 'HUF',
      groupName: 'Fagyi',
      payerName: 'Peti',
      distributionType: 'exactly',
    },
  ];
}
